#pragma once
#include <Vertex.h>

class Shape {
private:
	// Vertices
	static Vertex _cubeVertices[24];
	static Vertex _quadVertices[4];
#if WINDOW_APP
	static Vertex _sphereVertices[1025];
#endif

	// Indices
	static unsigned int _cubeIndices[36];
	static unsigned int _quadIndices[6];
#if WINDOW_APP
	static unsigned int _sphereIndices[5952];
#endif

	// Initialization
	static bool _cubeInitialized;
	static bool _quadInitialized;
#if WINDOW_APP
	static bool _sphereInitialized;
#endif

	// VBO
	static GLuint _cubeVBO;
	static GLuint _quadVBO;
#if WINDOW_APP
	static GLuint _sphereVBO;
#endif

	// EBO
	static GLuint _cubeEBO;
	static GLuint _quadEBO;
#if WINDOW_APP
	static GLuint _sphereEBO;
#endif

public:
	Shape() = default;
	~Shape() = default;

	// Get VBO
	static GLuint GetCubeVBO() {
		if (!_cubeInitialized) {
			glGenBuffers(1, &_cubeVBO);
			glBindBuffer(GL_ARRAY_BUFFER, _cubeVBO);
			glBufferData(GL_ARRAY_BUFFER, 24 * sizeof(Vertex), &_cubeVertices, GL_STATIC_DRAW);

			glGenBuffers(1, &_cubeEBO);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, _cubeEBO);
			glBufferData(GL_ELEMENT_ARRAY_BUFFER, 36 * sizeof(unsigned int), &_cubeIndices, GL_STATIC_DRAW);

			_cubeInitialized = true;

			glBindBuffer(GL_ARRAY_BUFFER, 0);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, 0);
		}

		return _cubeVBO;
	}

	static GLuint GetQuadVBO() {
		if (!_quadInitialized) {
			glGenBuffers(1, &_quadVBO);
			glBindBuffer(GL_ARRAY_BUFFER, _quadVBO);
			glBufferData(GL_ARRAY_BUFFER, 4 * sizeof(Vertex), &_quadVertices, GL_STATIC_DRAW);

			glGenBuffers(1, &_quadEBO);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, _quadEBO);
			glBufferData(GL_ELEMENT_ARRAY_BUFFER, 6 * sizeof(unsigned int), &_quadIndices, GL_STATIC_DRAW);

			_quadInitialized = true;

			glBindBuffer(GL_ARRAY_BUFFER, 0);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, 0);
		}

		return _quadVBO;
	}

#if WINDOW_APP
	static GLuint GetSphereVBO() {
		if (!_sphereInitialized) {
			glGenBuffers(1, &_sphereVBO);
			glBindBuffer(GL_ARRAY_BUFFER, _sphereVBO);
			glBufferData(GL_ARRAY_BUFFER, 1025 * sizeof(Vertex), &_sphereVertices, GL_STATIC_DRAW);

			glGenBuffers(1, &_sphereEBO);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, _sphereEBO);
			glBufferData(GL_ELEMENT_ARRAY_BUFFER, 5952 * sizeof(unsigned int), &_sphereIndices, GL_STATIC_DRAW);

			_sphereInitialized = true;

			glBindBuffer(GL_ARRAY_BUFFER, 0);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, 0);
		}

		return _sphereVBO;
	}
#endif

	// Get EBO
	static GLuint GetCubeEBO() {
		if (!_cubeInitialized) {
			glGenBuffers(1, &_cubeVBO);
			glBindBuffer(GL_ARRAY_BUFFER, _cubeVBO);
			glBufferData(GL_ARRAY_BUFFER, 24 * sizeof(Vertex), &_cubeVertices, GL_STATIC_DRAW);

			glGenBuffers(1, &_cubeEBO);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, _cubeEBO);
			glBufferData(GL_ELEMENT_ARRAY_BUFFER, 36 * sizeof(unsigned int), &_cubeIndices, GL_STATIC_DRAW);

			_cubeInitialized = true;

			glBindBuffer(GL_ARRAY_BUFFER, 0);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, 0);
		}

		return _cubeEBO;
	}

	static GLuint GetQuadEBO() {
		if (!_quadInitialized) {
			glGenBuffers(1, &_quadVBO);
			glBindBuffer(GL_ARRAY_BUFFER, _quadVBO);
			glBufferData(GL_ARRAY_BUFFER, 4 * sizeof(Vertex), &_quadVertices, GL_STATIC_DRAW);

			glGenBuffers(1, &_quadEBO);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, _quadEBO);
			glBufferData(GL_ELEMENT_ARRAY_BUFFER, 6 * sizeof(unsigned int), &_quadIndices, GL_STATIC_DRAW);

			_quadInitialized = true;

			glBindBuffer(GL_ARRAY_BUFFER, 0);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, 0);
		}

		return _quadEBO;
	}

#if WINDOW_APP
	static GLuint GetSphereEBO() {
		if (!_sphereInitialized) {
			glGenBuffers(1, &_sphereVBO);
			glBindBuffer(GL_ARRAY_BUFFER, _sphereVBO);
			glBufferData(GL_ARRAY_BUFFER, 1025 * sizeof(Vertex), &_sphereVertices, GL_STATIC_DRAW);

			glGenBuffers(1, &_sphereEBO);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, _sphereEBO);
			glBufferData(GL_ELEMENT_ARRAY_BUFFER, 5952 * sizeof(unsigned int), &_sphereIndices, GL_STATIC_DRAW);

			_sphereInitialized = true;

			glBindBuffer(GL_ARRAY_BUFFER, 0);
			glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, 0);
		}

		return _sphereEBO;
	}
#endif

	// Get Vertices Count
	static size_t GetCubeVerticesCount() {
		return 24;
	}

	static size_t GetQuadVerticesCount() {
		return 4;
	}

#if WINDOW_APP
	static size_t GetSphereVerticesCount() {
		return 1025;
	}
#endif

	// Get Indices Count
	static size_t GetCubeIndicesCount() {
		return 36;
	}

	static size_t GetQuadIndicesCount() {
		return 6;
	}

#if WINDOW_APP
	static size_t GetSphereIndicesCount() {
		return 5952;
	}
#endif
	
	// Get Indices
	static unsigned int* GetCubeIndices() {
		return _cubeIndices;
	}

	static unsigned int* GetQuadIndices() {
		return _quadIndices;
	}

#if WINDOW_APP
	static unsigned int* GetSphereIndices() {
		return _sphereIndices;
	}
#endif

	static void Deinit() {
		if (Shape::_cubeInitialized) {
			glDeleteBuffers(1, &Shape::_cubeVBO);
			glDeleteBuffers(1, &Shape::_cubeEBO);
		}

		if (Shape::_quadInitialized) {
			glDeleteBuffers(1, &Shape::_quadVBO);
			glDeleteBuffers(1, &Shape::_quadEBO);
		}

#if WINDOW_APP
		if (_sphereInitialized) {
			glDeleteBuffers(1, &Shape::_sphereVBO);
			glDeleteBuffers(1, &Shape::_sphereEBO);
		}
#endif
	}
};

